import NavBar from '../components/navBar';
import { BrowserRouter, Routes,Route } from 'react-router-dom';
import Comments from '../../../server/schemas/comment';

const HodiApp = () => {
    return ( 
        <>
        
            <NavBar/>

            <BrowserRouter>
            
                <Routes>

                    <Route path='/' element={<Comments/>}/>

                </Routes>

            </BrowserRouter>
        
        </>
     );
}
 
export default HodiApp;
